/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import React from "react";
import Rhombus from "../images/rhombus.svg";
import GitHubButton from "react-github-btn";

const mobile = `@media (max-width: 500px)`;

const AboutFooter = styled.footer`
  display: flex;
  justify-content: space-around;

  ${mobile} {
    transform: rotate(-90deg);
  }
}
`;

const FooterEmail = styled.div`
  color: grey;
  font-family: Good-Times-Regular;
  width:100%;
  text-align: center;
  postion: relative;
  z-index: 1000;

  ${mobile} {
    top: 130px;
    right: 300px;
    position: absolute;
  }
}
`;

const GithubContainer = styled.div`
  margin-top: 25px;
  position: fixed;
  bottom: 0;
  right: 0;

  ${mobile} {
    top: 130px;
    right: 800px;
  }
}
`;

export const Footer = () => (
  <AboutFooter>
    <GithubContainer>
      <GitHubButton
        href="https://github.com/jschriemer/jschriemer.github.io"
        data-color-scheme="no-preference: dark_dimmed; light: dark; dark: dark_dimmed;"
        data-size="large"
        aria-label="Star jschriemer/jschriemer.github.io on GitHub"
      >
        Star
      </GitHubButton>
    </GithubContainer>
    <FooterEmail>
      <p>jschriem@gmail.com</p>
    </FooterEmail>
  </AboutFooter>
);
